import React from "react";

const StartButton = ({ startGame }) => {
  return (
    <div>
      <button
        onClick={() => startGame}
        className="button-difficulty start-button"
      >
        Start Game
      </button>
    </div>
  );
};

const mapStateToProps = (state) => {
  return state;
};

export default connect(mapStateToProps, {
  setGameStatus,
  setLoadingStatus,
  setDifficutyMessage,
})(StartButton);
